import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './Profile.css';

const Profile = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [showAddFunds, setShowAddFunds] = useState(false);
  const [amount, setAmount] = useState('');
  const [error, setError] = useState('');

  const fetchUserData = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5002/api/users/profile', {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });
      setUser(response.data);
      localStorage.setItem('user', JSON.stringify(response.data));
    } catch (err) {
      console.error('Error fetching user data:', err);
      if (err.response?.status === 401) {
        navigate('/login');
      }
    }
  };

  useEffect(() => {
    fetchUserData();
  }, [navigate]);

  const handleAddFunds = async (e) => {
    e.preventDefault();
    setError('');

    try {
      const token = localStorage.getItem('token');
      await axios.post('http://localhost:5002/api/users/add-funds', 
        { amount: parseFloat(amount) },
        {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json'
          }
        }
      );

      setAmount('');
      setShowAddFunds(false);
      fetchUserData(); // Refresh user data to show updated balance
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to add funds');
    }
  };

  if (!user) return null;

  return (
    <div className="profile-container">
      <div className="profile-card">
        <div className="profile-header">
          <div className="profile-avatar">
            <span>{user.name.charAt(0).toUpperCase()}</span>
          </div>
          <h1>{user.name}</h1>
          <p>{user.email}</p>
          <span className="user-type">{user.userType}</span>
        </div>

        <div className="profile-info">
          <div className="info-section">
            <h3>Account Information</h3>
            <div className="info-item">
              <label>Name:</label>
              <span>{user.name}</span>
            </div>
            <div className="info-item">
              <label>Email:</label>
              <span>{user.email}</span>
            </div>
            <div className="info-item">
              <label>User Type:</label>
              <span>{user.userType}</span>
            </div>
            <div className="info-item">
              <label>Member Since:</label>
              <span>{new Date(user.createdAt).toLocaleDateString()}</span>
            </div>
            <div className="info-item wallet-balance">
              <label>Wallet Balance:</label>
              <span>₹{user.walletBalance?.toFixed(2) || '0.00'}</span>
            </div>
          </div>

          <div className="profile-actions">
            <button className="edit-profile-btn">Edit Profile</button>
            <button className="change-password-btn">Change Password</button>
            <button className="add-funds-btn" onClick={() => setShowAddFunds(true)}>Add Funds</button>
          </div>
        </div>
      </div>

      {showAddFunds && (
        <div className="modal-overlay">
          <div className="modal">
            <h2>Add Funds to Wallet</h2>
            {error && <div className="error-message">{error}</div>}
            <form onSubmit={handleAddFunds}>
              <div className="form-group">
                <label>Amount (₹):</label>
                <input
                  type="number"
                  min="1"
                  step="any"
                  value={amount}
                  onChange={(e) => setAmount(e.target.value)}
                  required
                />
              </div>
              <div className="modal-actions">
                <button type="button" onClick={() => setShowAddFunds(false)}>Cancel</button>
                <button type="submit">Add Funds</button>
              </div>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default Profile;
